import logo from './logo.svg';
import './App.css';
import Nav from './Components/Navigation/NavBar';
import Home from './Components/HomePage/Home';
import slBODY from '../slBODY.png'



function App() {
  return (
    <div style={{ backgroundImage: `url({slBODY})`, height: '100vh', backgroundSize: 'cover' }}>
      <Nav/>
      <div>
        <Home/>
      </div>
    </div>
  );
}

export default App;
